The Approved Provider must:
• Ensure that the person with management or control, nominated supervisor, educational leader employed or appointed and all educators employed at the Service attend an educative forum conducted by the Department in relation to the content and application of the Education and Care Services National Law Act 2010 and the Education and Care Services National Regulations 2011, including the requirements of the National Quality Standard, by 15 December 2020. 2. The Approved Provider must:
• Engage a recognised early childhood consultant or expert to work with the Service to provide professional development to the Approved Provider, person with management or control, nominated supervisor, educational leader and all educators at the service on the following areas:
o Effective skills in leadership and service management;
o Developing effective educational programs that are based on an approved learning framework and documenting of child assessments or evaluations, so that each child’s learning and development is assessed as part of an ongoing cycle of planning, documenting and evaluation;
o Gain knowledge to build skills in developing effective programs that meet the needs of all children and enable them to interact meaningfully and promote positive guidance and encouragement with all children;
o The Child Safe Standards to ensure that educators are aware of their roles and responsibilities to respond to every child at risk of abuse and neglect.
• Ensure that the training provider is approved in writing by the Regulatory Authority prior to their engagement, and ensure the professional development is completed by 31 January 2021, and
• Provide the Regulatory Authority with a report evidencing the completion of the professional development and training.

