The Approved Provider is required to ensure objects are not placed in a manner that may allow a child to climb over barriers or fences; and, all play equipment in the outdoor play spaces are maintained and placed in a way that meets the requirements of the Australian Playground Standards (Standard AS 4685:2014) with particular consideration given to falling space, impact areas and free space. The Approved Provider must engage an appropriate expert such as fire safety advisor or fire safety engineer to observe and prepare a report on the emergency and evacuation procedure rehearsal of the service. This must occur at the first rehearsal of the emergency and evacuation procedure. The report prepared must identify:
a.	the service;
b.	the date and time of the rehearsal;
c.	the total time taken to evacuate the building;
d.	the location to which building occupants were evacuated to;
e.	the number of children and educators in attendance on the day;
f.	the profile of children (ages, any disabilities) with respect to the children’s rooms operating at the time of the rehearsal; and
g.	any proposed actions the service must take to improve evacuation procedures to ensure the safety of all children attending the service.
 The approved provider must submit a copy of any report produced in relation this condition to the Regional Office of the Regulatory Authority in which the service is located within seven (7) days of receipt. The approved provider must ensure that all staff have read and are familiar with the supervision plan and risk assessment for the ground floor outdoor space.

